import React, { Component } from 'react'

export default class ListDerangemet extends Component{
    constructor(props)
    {
        super(props)
        this.state={
            listDer:[]
        }
    }
    componentDidMount()
    {
        fetch('https://localhost:5000/derangement/afficherAttente/web/'+this.props.location.state.service, {
            method: 'GET',
            headers: {
             // 'Accept': 'application/json',
              'Content-Type': 'application/json',
            },
          })
            .then((response) => response.json())
            .then((responseJson) => {
                this.setState({listDer:responseJson},()=>console.log(this.state.listDer))
             
            });
    }
  render()
  {
      return(
        <div>
        <h1>list deran </h1>
        </div>
      )
  }
};
